import React, { Component } from 'react';

class Todo extends Component{
    create(item){
        return <li key ={item.key}>{item.text}</li>
    }
    render(){
        var todoEnter = this.props.entries;
        var listItems = todoEnter.map(this.create);
        return(
            <ul className="theList">
                {listItems}
            </ul>

        );
    }

}
export default Todo;
